import "./Book.css";

export const Book = (props) => {
  return (
    <div className="book">
      <h3>{props.title}</h3>
      <img src={props.image} alt="image" />
      <ul>
        <li>add to currently reading</li>
        <li>add to read later list</li>
      </ul>
    </div>
  );
};

export default Book;
